import css from "styled-jsx/css";

export const style = css`
main{
   display: flex;
   width:100%;
   justify-content: center;
  .container{
      display: flex;
      flex-direction: column;
      align-items: center;
      width: 80%;
      .card:not(:last-child){
         width: 100%;
         border: solid gray 1px;
         margin-bottom: 2rem;
         padding: 2rem;
      }
  }
}
`
